INSERT INTO `eventbritedata` VALUES ('37629387511','“Listening to China”, A Conversation with David Walker','“Listening to China”, A Conversation with David Walker\\n  \\n2019 Senior Women Leaders – A Trade Mission with A Difference\\n\\nTo launch the 2019 Senior Women Leaders Trade Mission to China, we invite you to join us for a Q&A session about the mission, China and the emerging technology sector in one of the world’s largest economies. \\n \\nDavid Walker is an Australian academic historian who has been the professor of Australian studies at Deakin University since 1991. He is a leading authority in the study of Australian perceptions of Asia.\\n \\nProfessor Walker has written extensively on Australian perceptions of Asia across the period from the nineteenth century to the present. His prize-winning history, Anxious Nation: Australia and the Rise of Asia, 1850 to 1939 has just been joined by his new book, Stranded Nation: White Australia in an Asian Region published in March. \\n \\nIn conversation with Professor Walker, we will discuss his new book and some of the observations that he made throughout a remarkable career as one of the most astute and respected figures in cross cultural engagement between China and Australia.  \\n \\nIn addition to his extensive written works on Australia’s relationship with China, Walker was also appointed as the inaugural BHP Billiton Professor in Australian Studies at Peking University. An initiative of the Australia-China Council, the Foundation for Australian Studies in China, BHP Billiton, Peking University and the Australian Department of Industry and was the first high-profile, privately funded Australian professorial position in China. \\n \\nReturning to Melbourne, he became a Director and Board of the Foundation for Australian Studies in China (FASIC). FASIC is the only not for profit private sector initiative of its kind in Australia, generously supported by BHP, and designed to promote the study of Australia in China. David is a Fellow of the Academy of the Social Sciences in Australia and of the Australian Academy of the Humanities. \\n \\nAbout the Mission\\nWith a focus on Artificial Intelligence and FinTech, this trip will include opportunities to visit some of the most interesting, fast growth companies in the country. While the news is often dominated by a handful of Chinese companies well known to the West, the CATIC team have devised a program to learn from a host of lesser known yet dynamic and influential organisations across AI and entertainment, automotive, banking and finance, healthcare and education. \\n \\nThis mission is an ideal opportunity for any female senior executive to better understand China’s business and technology plans, as well as the history and culture that underpin them. \\n \\nThis mission is not just about learning from business. It is a well-rounded program that includes the opportunity to meet with young entrepreneurs returning to China from international study and Australian trade officials on the ground facilitating connections and trade between our countries. We will also meet University students to gain a better understanding of university life and their preparations to enter the ever-changing Chinese workforce. \\n \\nWhile this mission is about China, it has been designed for executive women who are keen to be informed and inspired about how Australia can shape its own future. As our economy continues to transition, this is an opportunity to move past the newspaper headlines, to invest in better understanding the history, culture and forward plans of our largest trading partner. \\n \\nThe 2019 Senior Women Leader’s trade mission to China hosted by China Australia Trade and Investment Council is now open for expression of interest. For more information about the 2019 program, follow the link: https://catic.org.au/senior-women-leaders/\\n\\nAgenda\\n5:30pm - 6:30pm Networking Drinks\\n6:30pm - 7:10pm A Converstation with Professor David Walker (Interview by Corrie McLeod, 2019 Mission Leader, Publisher at InnovationAus.com)\\n7:10pm - 7:30pm Listen to Senior Women Leaders about their China experience\\n \\nThis event is sponsored by The Mitchellake Group http://www.mitchellake.com/.','“Listening to China”, A Conversation with David Walker\\n  \\n2019 Senior Women Leaders – A Trade Mission with A Difference\\n\\nTo launch the 201','https://www.eventbrite.com.au/e/listening-to-china-a-conversation-with-david-walker-tickets-37629387511?aff=ebapi','16/05/2019','17:30:00','19:30:00','32130943','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61800515%2F225275071756%2F1%2Foriginal.20190507-013935?h=200&w=450&auto=compress&rect=0%2C189%2C794%2C397&s=ba9a3d9ad329ed9dadcfdec25cf82995','Chinese','Level 17, 31 Queen Street, Melbourne, VIC 3000'),('45187552185','Mandarin Online Course for Beginners - Expression of Interest','The Confucius Institute at the University of Melbourne\'s Online Course for Beginner Mandarin Chinese.\\n1A Beginner Chinese (no previous language learning required) -\\nThis course will run for 10 weeks, twice a week for 1 hour a day.\\nTime: 1pm - 2pm on Tuesday and Thursday \\nDates: 23 July to 26 September 2019\\n\\nThis Online Course is popular among Chinese language learners who are unable to attend class in person. It provides a platform to access a professional, engaging, and thorough Mandarin course regardless of where the students are. Using Zoom, our Chinese language teacher is able to engage with the students through a video conference, and share informative slides and teaching material. Students also receive a text book in which they use to follow the course content, and complete homework tasks. Each lesson is audio recorded and sent to the students for catch-up or revision.','The Confucius Institute at the University of Melbourne\'s Online Course for Beginner Mandarin Chinese.\\n1A Beginner Chinese (no previous langu','https://www.eventbrite.com.au/e/mandarin-online-course-for-beginners-expression-of-interest-tickets-45187552185?aff=ebapi','23/07/2019','13:00:00','14:00:00','30826694','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F58446021%2F120782698679%2F1%2Foriginal.20190313-222713?h=200&w=450&auto=compress&rect=35%2C0%2C302%2C151&s=2f072a117af0afdb463b4e711913aca0','Chinese','The Peter McPhee Centre, 272 - 278 Faraday St,, Carlton, VIC 3052'),('53288098136','WHISKYS FROM AROUND THE WORLD – PUBLIC CLASS','Everyone knows Scotland is the biggest producer of whisky in the world, but did you know about award-winning whisky from Taiwan, India and even in our own backyard? Come and explore the weird and wonderful whiskies being made in all corners of the globe with this class.\\nOver the course of an hour and a half you will be guided through a selection of whisky’s by our experienced bartenders while sharing in a charcuterie board. To finish the class off each guest gets to sit back, relax and enjoy a tailored old fashion, highlighting the flavours and journey of the class.','Everyone knows Scotland is the biggest producer of whisky in the world, but did you know about award-winning whisky from Taiwan, India and e','https://www.eventbrite.com.au/e/whiskys-from-around-the-world-public-class-tickets-53288098136?aff=ebapi','18/05/2019','19:00:00','20:00:00','28196366','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F53528050%2F145913104691%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C128%2C1000%2C500&s=828350f7b0ad739110220e44005ba9b9','Indian','401 Brunswick Road, Brunswick, VIC 3056'),('53798942084','Indian Women\'s Support Group','Indian Women\'s support group for social interaction and combat isolation','Indian Women\'s support group for social interaction and combat isolation','https://www.eventbrite.com.au/e/indian-womens-support-group-tickets-53798942084?aff=ebapi','20/05/2019','11:30:00','13:30:00','28364776','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F54023615%2F29519680353%2F1%2Foriginal.20181217-023553?h=200&w=450&auto=compress&rect=0%2C0%2C640%2C320&s=811b0104d431520a0353d9f1050b9bc7','Indian','83 Penrose Promenade, Tarneit, VIC 3029'),('53844975772','Tai Chi and Qigong for Beginners in Northcote','Beginners Tai Chi and Qigong Classes in Northcote\\nTai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been practiced in China since the 16th Century. It is a tranquil and graceful way of keeping fit, improving your health, and helping to prevent the stresses and strains of modern living. Classes include Qigong breathing and meditation techniques; strength, flexibility, balance and coordination exercises; martial applications, forms and in time, weaponry. The classes are created as the perfect mind-body exercise program for all Australians based on well-researched and tested guidelines from the best sport universities, organisations and professionals in China and Australia. They work to provide you with the perfect mind-body exercise program suitable for all ages and fitness levels.\\nIf you enjoy your first FREE class, please discuss ongoing class fees with us.','Beginners Tai Chi and Qigong Classes in Northcote\\nTai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been','https://www.eventbrite.com.au/e/tai-chi-and-qigong-for-beginners-in-northcote-tickets-53844975772?aff=ebapi','16/05/2019','18:30:00','19:30:00','18818028','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29422970%2F206466018621%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C431%2C5184%2C2592&s=d045e794798dfd567039ee8250510087','Chinese','251 High Street, Northcote, Victoria 3070'),('53845218498','Tai Chi and Qigong for Beginners in Docklands','Tai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been practiced in China since the 16th Century. It is a tranquil and graceful way of keeping fit, improving your health, and helping to prevent the stresses and strains of modern living. Classes include Qigong breathing and meditation techniques; strength, flexibility, balance and coordination exercises; martial applications, forms and in time, weaponry. The classes are created as the perfect mind-body exercise program for all Australians based on well-researched and tested guidelines from the best sport universities, organisations and professionals in China and Australia. They are suitable for all ages and fitness levels.\\nThis particular class is a great way to start the day overlooking the beautiful Victoria Harbour. The class is conducted outside so make sure you wear appropriate clothing. We usually train on The Deck at the front of the building facing out to the harbour. If it is raining, don\'t worry!! We will re-locate to the 3rd Floor Terrace Space of The Dock building. However, make sure to arrive 10 minutes early and wait on the North Wharf side of the building as access is via a security entrance facing out to the lawn. If you are late please ring 0407 941 101 to gain admittance.\\nIf you enjoy your first FREE class, please discuss ongoing class fees with us.','Tai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been practiced in China since the 16th Century. It is a','https://www.eventbrite.com.au/e/tai-chi-and-qigong-for-beginners-in-docklands-tickets-53845218498?aff=ebapi','16/05/2019','7:30:00','8:30:00','22873763','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F39758235%2F206466018621%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C188%2C1200%2C600&s=d4e8787e27e6e3940148d37771c8ff81','Chinese','107 Victoria Harbour Promenade, Docklands, VIC 3008'),('53845357915','Tai Chi and Qigong for Beginners in Armadale','Tai Chi and Qigong for Beginners in Armadale\\nTai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been practiced in China since the 16th Century. It is a tranquil and graceful way of keeping fit, improving your health, and helping to prevent the stresses and strains of modern living. Classes include Qigong breathing and meditation techniques; strength, flexibility, balance and coordination exercises; martial applications, forms and in time, weaponry. The classes are created as the perfect mind-body exercise program for all Australians based on well-researched and tested guidelines from the best sport universities, organisations and professionals in China and Australia. They work to provide you with the perfect mind-body exercise program suitable for all ages and fitness levels.\\nIf you enjoy your first FREE class, please discuss ongoing class fees with us.','Tai Chi and Qigong for Beginners in Armadale\\nTai Chi (Taijiquan in Chinese) is literally an internal Chinese Martial Art that has been pract','https://www.eventbrite.com.au/e/tai-chi-and-qigong-for-beginners-in-armadale-tickets-53845357915?aff=ebapi','16/05/2019','10:00:00','11:00:00','19999830','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F29423427%2F206466018621%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C431%2C5184%2C2592&s=9e14bfd267637128e53a80aca8360f06','Chinese','88 Kooyong Road, Armadale, VIC 3143'),('54840846448','Comprehensive Health - Australia-China Trade Expo 2019','Australia-China Trade Expo(ACTE 2019) is a comprehensive international event with 13 years history. It has the largest scale, the most complete exhibit variety, the largest buyer attendance and broadest distribution of buyers\' source. \\nThe exhibition is a business platform for expanding business opportunities in Australia and Western companies, and building a trading platform for merchants and buyers. The content covers commodity trading, service trade, project investment, cultural exchange, economic and trade seminars and other commercial fields.\\nAfter 13 years\' reform and innovative development, ACTE has withstood various challenges and never been interrupted. ACTE enhances trade connection between China and Australia, demonstrating exhibitors\'s company image.','Australia-China Trade Expo(ACTE 2019) is a comprehensive international event with 13 years history. It has the largest scale, the most compl','https://www.eventbrite.com.au/e/comprehensive-health-australia-china-trade-expo-2019-tickets-54840846448?aff=ebapi','13/09/2019','10:00:00','18:00:00','28786781','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F55079289%2F241944192492%2F1%2Foriginal.20190114-043754?h=200&w=450&auto=compress&rect=0%2C68%2C1268%2C634&s=6eb519ecabf2d0ab075ae604661d8615','Chinese','South Wharf, VIC 3006'),('56766583379','African Foodie Trail - Footscray','East African cuisine has had influences from Indian, French, British, Egyptian and Turkish flavours to name a few. In a journey through the sub Saharan Africa, taste the blends of spices, in a bowl of fufu, a warm piece of Injera (Ethiopian bread) or matoki (lamb stew). Sudan\'s more common foods are kisira (a type of pancake), rice, asida (ugali, or stiff porridge), and fish. In Ethiopia, typical foods would be injera/firfir, kichah (spiced pancake), dabo (bread), and bula (ensete, or stiff porridge). These are normally served with a variety of hot sauces (wat, or watt) on one large tray for the entire family.\\nWe explore Footscray on our journey through Africa. With a population of over 5000 African decedents, it is the perfect place to try some authentic bread, buy some berbere spices and get your hands on the original coffee from Ethiopia. Get ready for a gastronomical experience for your taste buds.\\nWe guarantee you will be back for more!\\nInclusions\\nVisit to a grocery shop and the opportunity to learn about the spices.A Progressive 3 course Lunch an African restaurant and cafe\\nTour Starting Point: Outside Footscray Station on Irving Street.\\nThings to keep in mind:This is a walking tour; it is not fast-paced and is comfortable for most people. The walk from the various venues is about 30-40 minutes in total with breaks at each vendor; we recommend that you wear comfortable shoes.\\nTours held alternate weekends but if a date of your preference is not listed, please give us a call and we will do our best to add additional tours. More dates to be released soon. Please email us if you would like to be notified. Alternatively, you may like to book a private tour (5 people minimum).\\nGot a question? email us at tours@foodietrails.com.au or call 1800 66 77 91','East African cuisine has had influences from Indian, French, British, Egyptian and Turkish flavours to name a few. In a journey through the','https://www.eventbrite.com.au/e/african-foodie-trail-footscray-tickets-56766583379?aff=ebapi','25/05/2019','11:30:00','14:30:00','29735943','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F56963615%2F35644480928%2F1%2Foriginal.20190218-021418?h=200&w=450&auto=compress&rect=0%2C233%2C2448%2C1224&s=3c0a1d85142c2c205df6c29eb803512a','Indian','Footscray, VIC 3011'),('56834261807','Masala Foodie Trails- CBD','Indians came to the shores of Australia many years ago and with them they have brought culture, spices and delicious Indian food. Come explore with us the flavours of Indian food, learn about the spices and the regions and delight your palette. The opportunity to learn from our experts the uses of spices in various foods and their benefits. We start our story with the arrival of the Indian community in Australia and how their aromatic spices were stirred into Modern Australian cuisine. Continuing to the subtly spiced rice based cuisine of South India; guests will travel through the cuisines of India in all their variety and diversity down to the rich Punjabi food spiced with garam masala of the north and conclude with an offering of Indian deserts like you\'ve never experienced before. \\nJoin us in exploring some of the uniquely Indian restaurants around Melbourne city, from small cafes to fine dining restaurants. We’ll show you Melbourne’s Indian side. \\nInclusions Visit an Indian Grocery shop and the opportunity to learn about Indian spices.A Progressive 3 course Lunch at Indian cafe/restaurant Tour Starting point Outside 7 Eleven (near the orange umbrellas of Time Out Cafe)  in Federation Square, Flinders Street, Melbourne.Things to keep in mind: This is a walking tour; it is not fast-paced and is comfortable for most people. The walk from the various venues is about 30-40 minutes in total with breaks at each vendor; we recommend that you wear comfortable shoes. Tours alternate weekends, if a date of your preference is not listed, please give us a call and we will do our best to add additional tours. More dates to be released soon. Please email us if you would like to be notified. Alternatively, book a private tour (min 5 guests). \\nGot a question? Email us at tours@foodietrails.com.au or call 1800 667 791','Indians came to the shores of Australia many years ago and with them they have brought culture, spices and delicious Indian food. Come explo','https://www.eventbrite.com.au/e/masala-foodie-trails-cbd-tickets-56834261807?aff=ebapi','1/06/2019','11:30:00','14:30:00','29765385','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57011852%2F35644480928%2F1%2Foriginal.20190218-213526?h=200&w=450&auto=compress&rect=0%2C498%2C3984%2C1992&s=1b2c4b803ce37e38517956be5e3cfc2a','Indian','2 Swanston Street, Melbourne, VIC 3000'),('56837267798','Spice Factory- Indian Cooking Class','Join us for a class on Indian Home Cooking, specifically the Thali meal. The Indian Thali is not just a meal or a plate; it is, in fact, a tradition. Within the rim of the plate are many traditions handed down from one generation of cooks to the next abound. The class will talk about the thali and the culinary heritage behind it that makes every element of it so important to a balanced diet. \\nA cooking demonstration and hands-on class of a full meal where guests learn to cook an Indian meal that everyone savours together.With over 5 items on the menu from an entree, to the main course and side dishes, this is the perfect class to learn an Indian banquet to wow your friends and family at the next get together!\\nClass Duration \\nThe course is 3 hours in duration.CookingAll participants will be given the opportunity to prepare and cook.Participants will be provided with all the necessary utensils and utilise commercial cooking equipment supplied by our venue. \\nRecipe Pack \\nEach participant receives a recipe pack so they have all the information to prepare this meal at home for friends and family.\\nVenue : \\nTwo Kings Café\\n353 Centre Rd, Bentleigh VIC 3204\\nVenue - 2 min walk from Bentleigh Station \\nMore Information \\nThe class is not a cooking course, it is an informal session where we learn the basics and share our experiences. We are not professional chefs just home taught by our families and enjoy cooking and celebrating with food. Come for an afternoon of fun, and celebration with food.','Join us for a class on Indian Home Cooking, specifically the Thali meal. The Indian Thali is not just a meal or a plate; it is, in fact, a t','https://www.eventbrite.com.au/e/spice-factory-indian-cooking-class-tickets-56837267798?aff=ebapi','22/05/2019','17:30:00','20:30:00','22121375','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57013529%2F35644480928%2F1%2Foriginal.20190218-220736?h=200&w=450&auto=compress&rect=0%2C595%2C4032%2C2016&s=ba437db0f8640fa4450f5c95568241b9','Indian','353 Centre Road, Bentleigh, VIC 3204'),('57066745171','Australian China Business Week','Australia-China BusinessWeek is the major Sino Australian business forum and this year marks the second decade of this high-profile event, which has over the past ten years, been presented in Sydney, Melbourne, Hobart, Brisbane, Adelaide. ACBW has also been presented in China, including Shanghai, Guangzhou, Xiamen and Fuzhou. Over 10,000 delegates and fifty inbound Chinese Delegations have attended hundreds of seminars, conferences, luncheons, networking and business matching sessions presented in both English and Mandarin.\\nLeaders from Government and industry from Australia, China and Asia have shared their China journey, experiences and provided insight, advice and encouragement for companies engaged or about to enter the China market.','Australia-China BusinessWeek is the major Sino Australian business forum and this year marks the second decade of this high-profile event, w','https://www.eventbrite.com/e/australian-china-business-week-tickets-57066745171?aff=ebapi','31/07/2019','9:00:00','18:30:00','29864804','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57173141%2F233834486161%2F1%2Foriginal.20190221-043825?h=200&w=450&auto=compress&rect=0%2C4%2C296%2C148&s=4ef6b2967b4acfb3eb0279fe64dd3771','Chinese','501 Bourke Street, Melbourne, VIC 3000'),('57566909175','Negotiations and Influence in an Asian Context - INDIA (Melbourne)','Collaborate. Negotiate. Resolve conflict. Optimise stakholder alignment.\\nIf you are conducting negotiations with Indian counterparts, a strong understanding of how process, commercial issues and culture impacts negotiation styles is critical. • What processes may be adopted to achieve mutual gains with an Indian counterpart in a negotiation? • How do you plan for and respond to lengthy multi-stage negotiations with Indian counterparts? • How does culture affect commercial outcomes in a negotiation with Indian counterparts? \\nThe ApproachThis practical, participatory one-day program combines global perspectives on cross-cultural negotiation with Australian executive insights and reflections from Indian counterparts. It incorporates the Consensus Building Institute’s world-leading Mutual Gains Approach, built in partnership with faculty from Harvard and MIT, which utilises a practical four-step methodology for improving negotiation results in Indian contexts:\\n1. Prepare – Estimate your Best Alternative to Negotiated Agreement (BATNA) and identify the interests of your Indian counterparts\\n2. Create Value – Invent without committing. Float options that consider the differences between parties. \\n3. Distribute Value – Behave in ways that build trust. Find objective values both parties can use to justify mutually beneficial sharing of the value created. \\n4. Follow Through – Specify mechanisms to deal with predictable surprises. Agree on monitoring arrangements, including metrics. \\nWhat you will learn\\nThis program will help you learn to enhance your commercial relationships and achieve optimal business outcomes in an Indian context.\\nFacilitators\\nAndrew Wei-Min Lee is a Fellow of Harvard Law School’s Program on Negotiation and Stanford Law School’s Gould Center for Conflict Resolution. For over 14 years, he has led training workshops on negotiation and business in China as well as business negotiations with Chinese counterparts in the United States, Singapore, the Netherlands, Russia, Austria, Japan and France. He has cooperated with universities to deliver programs to Australian executives visiting China. Participants have included personnel from Penfolds Winery, the Australian Tax Office, Minter Ellison Lawyers and Pura Milk. In 2011, he was appointed a World Bank mediator for Greater Asia.\\nShiraz Engineer is the Associate-Director of Strategy and Capability at Asialink Business. Shiraz has lived and worked within an Asian context for over two decades. His qualifications include a Master of Business Administration and Commerce. Shiraz has vast business experience across multiple industries. Shiraz designs and delivers capability development programs to help organisations develop their cultural intelligence, and sustain operations in culturally diverse situations. Shiraz also provides practical market and industry focused advice to assist Australian businesses enter Asian markets.\\nA highly interactive training program that combines a world re-nowned negotiation framework and global insights on cross-cultural negotiation with Australian executives\' experiences with their Indian counterparts. \\nFor enquiries: contact Michelle Borzi on 0421 443 439 or email m.borzi@asialinkbusiness.com.au','Collaborate. Negotiate. Resolve conflict. Optimise stakholder alignment.\\nIf you are conducting negotiations with Indian counterparts, a stro','https://www.eventbrite.com.au/e/negotiations-and-influence-in-an-asian-context-india-melbourne-tickets-57566909175?aff=ebapi','20/05/2019','9:00:00','17:00:00','30128650','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57649537%2F154941325932%2F1%2Foriginal.20190301-003921?h=200&w=450&auto=compress&rect=228%2C0%2C1270%2C635&s=9003b4cb2ef77baf194394d587fdedea','Indian','131-135 Bourke Street, Melbourne, VIC 3000'),('57570599212','Parkville Chinese Program (Mandarin) 27/06/2019, 04/07/2019, 11/07/2019','CBE Chinese Program (Mandarin)\\n\\nYou will need to attend all three dates listed in the program title.\\n\\n\\n\\nSeries of 3 workshops held in CBE/Physio classroom on a Thursday from 10am - 1pm.\\n\\n\\n\\nPlease be on time for all workshops. Your partner/support person is encouraged to attend the workshops with you. One ticket is for both you and your partner or support person to attend.\\n\\nPlease ensure when booking your workshops that they are completed before your 36th week of pregnancy. \\n\\n Labour and Birth topics include:\\n\\n\\n\\nSigns of labour\\n\\nWhen to come to hospital\\n\\nProgress of labour and birth\\n\\nRole of support person\\n\\nPractical coping methods during labour\\n\\nOptions for pain management\\n\\nUnexpected outcomes, such as emergency caesarean \\n\\n\\n\\nParenting and Breastfeeding Topics include:\\n\\n\\n\\nBreast changes in pregnancy\\n\\nUnderstanding breastfeeding\\n\\nHaving your baby in skin to skin contact and the first breastfeed\\n\\nNormal newborn feeding behaviour in the first 48 hours and beyond\\n\\nSafe sleeping and settling\\n\\nParenting and relationship changes \\n\\nCommunicating with your baby\\n\\nCommunity supports for the family\\n\\n\\n\\nHospital Tour Topics include:\\n\\n\\n\\nWhen and where to come to hospital\\n\\nParking options\\n\\nTour of Birth Centre and brief description of care during labour and birth\\n\\nTour of post-natal ward & discussion on care in the first few days\\n\\n\\n\\nIf you book a workshop but do not attend no refund will be given. A refund will only be available if cancellation is made at least one week before the first booked session.\\n\\nPlease choose your dates carefully as workshops book out quickly. It may not be possible to change your booking to a different date if your preferred date is already booked out.','CBE Chinese Program (Mandarin)\\n\\nYou will need to attend all three dates listed in the program title.\\n\\n\\n\\nSeries of 3 workshops held in CBE/Ph','https://www.eventbrite.com.au/e/parkville-chinese-program-mandarin-27062019-04072019-11072019-tickets-57570599212?aff=ebapi','27/06/2019','10:00:00','13:00:00','11566113','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57509810%2F138880387881%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C75%2C4374%2C2187&s=d9f846742aff44842ed66f337c5b170e','Chinese','Physio/Childbirth Ed Classroom Level 1 (behind the main lifts) 20 Flemington Road, Parkville, VIC 3052'),('58046322112','Purbayan Chatterjee in concert with Jay Dabgar','Experience Indian Classical music at its finest with a mesmerizing performance by the international master of Sitar, Pt. Purbayan Chatterjee, who will perform with the Melbourne-based Tabla whiz, Jay Dabgar. \\nThe duo will take you on a journey of hypnotising, energetic music of the Indian Classical genre. They will also be performing with the amazing artists from The Senagambian Jazz band, Amadou Suso, on the Kora. \\nThis performance will bring together a beautiful amalgamation of African and Jazz music with the mystical sounds of India.\\nPurbayan ChatterjeePurbayan is one of the finest Sitar players in Indian Classical music and holds a special place as a multifaceted performer in the world of music. Along with his concerts of North Indian raga music, he also performs with musicians from the South Indian raga tradition and participates in various fusion projects with jazz (His music has been appreciated by jazz greats, such as Chick Corea, Bella Fleck, and Pat Metheney).\\nHis soulful and dexterous performances have evoked praise and admiration in various music festivals in India and other countries. Purbayan is also astounding vocalist and has lent his soulful voice to many mellifluous compositions.\\nJay DabgarRecently finishing a very successful tour of Australia with the Grammy award winner and Padma Bhushan Pt. Vishwamohan Bhatt and Grammy nominee Ustad Shujaat Khan, local Tabla sensation Jay Dabgar will accompany Purbayan Chatterjee during his Australian tour.\\nDabgar will bring 24 years of Tabla playing experience to this highly anticipated show. His skills are well known throughout Australia as well as internationally.\\nKey Information:18 May 2019, 7PM (6.30 PM Doors)South Melbourne Town HallFishley St, South Melbourne VIC 3205\\nTickets:  Section AFull: $65 | Concession: $55 | Early Bird: $55 (available till 15 April 2019)\\nSection BFull: $55 | Concession: $45 | Early Bird: $45 (available till 15 April 2019)','Experience Indian Classical music at its finest with a mesmerizing performance by the international master of Sitar, Pt. Purbayan Chatterjee','https://www.eventbrite.com.au/e/purbayan-chatterjee-in-concert-with-jay-dabgar-tickets-58046322112?aff=ebapi','18/05/2019','19:00:00','21:00:00','30380965','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F57867367%2F175354994294%2F1%2Foriginal.20190305-045510?h=200&w=450&auto=compress&rect=0%2C22%2C1920%2C960&s=c70c7f6578317cb9061824456dd88965','Indian','Fishley Street, South Melbourne, VIC 3205'),('58192307759','Chinese Brush Calligraphy 18 May 50% off','if yo