in China','The administration of end of life care in China differs substantially from its organisation in the West. This presentation examines how the unequal distribution of health resources and increasing economisation of the medical industry in China creates problems for access to, and the quality of, end of life care. I suggest that we first need to recognise how the language of economisation suffuses relations between ageing patients, families and medical practitioners, before tracing how socioeconomic inequalities can lead to differential experiences of end of life care. This presentation thus explores how end of life care is becoming economised in China, and how patients themselves increasingly participate in an economy of ‘financialised human capital’.\\nAbout the Speaker\\nDr Marc Trabsky is a Senior Lecturer at La Trobe Law School and the Deputy Director of the Centre for Health Law and Society, La Trobe University. He writes in the intersections of legal theory, history and the humanities. His research examines the theoretical, historical and institutional arrangements of law and death. His most recent monograph is titled Law and the Dead: Technology, Relations and Institutions (Routledge, 2019).','The administration of end of life care in China differs substantially from its organisation in the West. This presentation examines how the','https://www.eventbrite.com.au/e/the-economisation-of-end-of-life-care-in-china-tickets-59804241095?aff=ebapi','13/06/2019','14:30:00','16:00:00','23426724','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F59595394%2F150142214675%2F1%2Foriginal.20190403-013646?h=200&w=450&auto=compress&rect=0%2C0%2C600%2C300&s=8be8e83520941bddf7272ad809accf04','Chinese','Room 318 Education 2 (ED2), La Trobe University, VIC 3086'),('59868360879','Chinese poetry reading evening with Ouyang Yu','Come and listen or share your own original poem in this Chinese poetry reading evening with Ouyang Yu. Ouyang Yu is a Chinese-Australian multi-award winning author of fiction, nonfiction, poetry, literary translation and criticism in both English and Chinese. His third novel, The English Class, won the 2011 NSW Premier’s Award, and his translation in Chinese of The Fatal Shore by Robert Hughes won the Translation Award from the Australia-China Council in 2014. Some of his books will be available for purchase on the night.\\nBoroondara Literary Festival event\\n这是欧阳昱中文诗歌朗诵晚会。请来听或分享您自己创作的诗歌。欧阳昱是一个获奖 丰硕的澳籍华人作家，包括用中英文创作的小说、非小说作品、文学翻译和文学批评。 他的第三本小说《英语课》（The English Class）获得 2011 年新南威尔士一等奖。他翻 译的罗伯特. 修斯（Robert Hughes）的作品《致命海滨》（The Fatal Shore）在 2014 年 获得澳中理事会翻译奖。','Come and listen or share your own original poem in this Chinese poetry reading evening with Ouyang Yu. Ouyang Yu is a Chinese-Australian mul','https://www.eventbrite.com.au/e/chinese-poetry-reading-evening-with-ouyang-yu-tickets-59868360879?aff=ebapi','20/06/2019','19:00:00','20:00:00','30634201','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61468193%2F49100826570%2F1%2Foriginal.20190430-223813?h=200&w=450&auto=compress&rect=0%2C166%2C800%2C400&s=f8201a9a7984bf384f4b3770b1e00e75','Chinese','2 Centre Way, Balwyn North, VIC 3104'),('59871304684','Womens Wellness: Learn how to Love, Nourish & Thrive Every Day!','Learn How to Use Chinese Medicine, Nutrition, Exercise and Sex to Optimise Your Health & Well-being!','Learn How to Use Chinese Medicine, Nutrition, Exercise and Sex to Optimise Your Health & Well-being!','https://www.eventbrite.com.au/e/womens-wellness-learn-how-to-love-nourish-thrive-every-day-tickets-59871304684?aff=ebapi','8/06/2019','10:00:00','14:30:00','31771119','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61795834%2F301050713049%2F1%2Foriginal.20190506-235258?h=200&w=450&auto=compress&rect=0%2C56%2C1920%2C960&s=fb40684ef4d612048d1ea66c4d88783d','Chinese','Need to Register'),('60013339514','MLC x ACYA Present - Amazing Race!','Hi there!\\n\\nWe are finally bringing the big Aus-China family together by holding this collabration event by MLC and ACYA!! We know that you are feeling a bit under the weather as Easter break is so short right? Don\'t worry! We have prepared this amazing event for you to experience excitement, joy, and make some new friends!  Are you up for some exciting games and yummy food?! Your answer must be A YES!!\\n\\nCome and join MLC x ACYA AMAZING RACE on Sunday, 19th of May at 2pm @South Lawn (Our starting point) and finish with delicious BBQ! \\n\\nRunning with fun mix of games for you to challenge along with your dedicated team! It’s a great chance for you to meet international friends. Amazing race is free for ALL MLC and ACYA members! So please don’t forget to bring you membership card when you come to meet us! Also remember to sign up on Eventbrite to gurantee your spot x\\n\\n Looking forward to seeing you for some awesome games and warm gathering','Hi there!\\n\\nWe are finally bringing the big Aus-China family together by holding this collabration event by MLC and ACYA!! We know that you a','https://www.eventbrite.com.au/e/mlc-x-acya-present-amazing-race-tickets-60013339514?aff=ebapi','19/05/2019','14:00:00','17:00:00','31432959','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61709988%2F204989473654%2F1%2Foriginal.20190505-043233?h=200&w=450&auto=compress&rect=0%2C58%2C1920%2C960&s=aeda6b538bfd418b8488ca4bd68ca10a','Chinese','Parkville, VIC 3052'),('60017416709','How India Works. Caste, community and capitalism.','Prof. Thomas Blom Hansen, Department of Anthropology, Stanford University\\nUntil the 1970s, India’s industrial and commercial economy was dominated by very small trading communities that converted their expertise and capital into modern industrial entrepreneurship. Beginning in the late 1980s, liberalization made the Indian economy vastly more dynamic but did it also transform the social basis of the private sector, or the labor market? Did a more open market also open opportunities for new groups and categories of people? Is there evidence that the high growth rates in India also break down barriers to social mobility as it has happened in other societies? Or are the deeper patterns of the Indian economy consolidating the existing distribution of opportunities, capital and employment?\\n \\nContact details: Sahar Ghumkhor ghumkhor@unimelb.edu.au','Prof. Thomas Blom Hansen, Department of Anthropology, Stanford University\\nUntil the 1970s, India’s industrial and commercial economy was dom','https://www.eventbrite.com.au/e/how-india-works-caste-community-and-capitalism-tickets-60017416709?aff=ebapi','16/05/2019','18:00:00','19:30:00','31389690','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F59896462%2F195054519403%2F1%2Foriginal.20190407-115835?h=200&w=450&auto=compress&rect=0%2C29%2C232%2C116&s=c5c9333e57501045daea42c191561949','Indian','Royal Parade Room 153 (Forum Theatre), Parkville, VIC 3052'),('60240908178','CRADLE Seminar Series: Jiming Zhou on Chinese Students\' First Year Experiences in Australian Universities','Assessment shock: Understanding Chinese international students\' first year experiences in Australian universities\\nDr Jiming Zhou, College of Foreign Languages and Literature, Fudan University\\nEducation practitioners in Australian universities face an ongoing problem: how can we acculturate the large population of Chinese international students to the Australian university learning context? Join Fudan University\'s Dr Jiming Zhou as she discusses the concept of “assessment shock” as experienced by Chinese international students in their first year in Australian universities, the cognitive and socio-cultural reasons behind the shock, and the pedagogical implications for assessment design and enactment.\\nThis seminar shares findings from a recent project exploring Chinese international students’ perceptions and practices related to assessment tasks in the first year at Deakin University. Ten students were recruited from each of the four broad disciplinary fields most frequently studied by Chinese international students, i.e. management and commerce, engineering and related technologies, information technology, and arts and education. Focus group discussions and individual interviews were conducted to explore students’ understandings and behavior related to various assessment tasks. One unit chair/tutor from each broad discipline was also interviewed to compare and contrast the educators’ perspective. \\nFindings suggest prior assessment experience mediates students’ perception of assessment tasks and culture. Students reported difficulties in 1) appreciating the values of some higher-order skills assessed in university contexts; 2) developing sophisticated understandings about “abstract” criteria; and 3) interacting with tutors about the meanings of assessment tasks and the way to move forward. \\nThe seminar will conclude with discussions about how understanding “assessment shock” carries the potential to enhance first-year student transition and develop learner assessment literacy.\\nAfter Jiming\'s presentation, join us for afternoon tea to continue the conversation around understanding the experiences of first-year Chinese students in Australian universities.\\nThis seminar will be available across all Deakin campuses via Skype for Business (please select your location via the ticketing options for room details), and will also be accessible to all non-Deakin locations online or over the phone (please select this ticketing option for further details).\\n\\nJiming Zhou is a senior lecturer at Fudan University, China. She holds a PhD in education from the University of Hong Kong. Her current research interests include assessment and learning, educational innovation, and students’ school-university transition.','Assessment shock: Understanding Chinese international students\' first year experiences in Australian universities\\nDr Jiming Zhou, College of','https://www.eventbrite.com.au/e/cradle-seminar-series-jiming-zhou-on-chinese-students-first-year-experiences-in-australian-registration-60240908178?aff=ebapi','21/05/2019','14:00:00','15:00:00','24672890','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60191413%2F255437069073%2F1%2Foriginal.20190411-054407?h=200&w=450&auto=compress&rect=0%2C0%2C2160%2C1080&s=b2c89d13e516867c6d5b9af6420cccc2','Chinese','727 Collins Street, Melbourne, VIC 3008'),('60240972370','ACBC Vic: Capturing the Chinese Tourist Market with Bill Lang','ACBC Victoria is pleased to invite you to our event ‘Capturing the Chinese Tourist Market’, with Bill Lang, Adjunct Fellow, VBCI, Chairman Institute of Advanced Business\\nOver the next 10 years, Chinese visitors to Australia are expected to grow by 11.9 percent per annum. Inbound Chinese tourism to Victoria is forecast to be worth $7.0 billion in 2026-27 (+10.3% pa) and contribute 39 per cent to total expenditure in Victoria.\\nWith this in mind it’s imperative that businesses are prepared to provide payment systems, hospitality and appropriate communication to meet the needs of Chinese tourists in Australia. To ‘capture’ this market, businesses need to have systems in place that will enable them to leverage opportunities across a wide range of sectors.\\nDuring this session, Bill will share his expertise on doing business with Chinese consumers, so you leave with a greater understanding of how to connect with this burgeoning market of customers.\\nAbout the Speaker\\nBill Lang is an expert in applying the latest strategies to help people rapidly build and develop digital skills to start and grow businesses. After graduating from Harvard Business School’s MBA as a Baker Scholar, Bill founded consulting, training, internet services and marketing technology businesses that have served clients operating in over 50 countries and educated over 100,000 people through his presentations, TV series, books and online services. Many of his clients have achieved significant business improvements and awards including Best in the World, Best in Europe and Best in Asia.\\nVictoria University is conveniently located at 300 Flinders Street opposite Flinders Street railway station and you can also travel via tram or bus. Please visit the Public Transport Victoria site to plan your journey. Commercial parking is also available close to 300 Flinders Street.','ACBC Victoria is pleased to invite you to our event ‘Capturing the Chinese Tourist Market’, with Bill Lang, Adjunct Fellow, VBCI, Chairman I','https://www.eventbrite.com.au/e/acbc-vic-capturing-the-chinese-tourist-market-with-bill-lang-tickets-60240972370?aff=ebapi','18/06/2019','12:15:00','14:00:00','31479828','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60191670%2F238725079340%2F1%2Foriginal.20190411-055026?h=200&w=450&auto=compress&rect=22%2C0%2C2528%2C1264&s=456f4f89b42e2eca15777fc7b2336cf5','Chinese','300 Flinders Street , Melbourne, VIC 3000'),('60292716137','How to create a Chinese name for your brand','It is no doubt that the relationship between Australia and China is becoming stronger. In 2017-18, China was by far Australia\'s largest trading partner, contributing $194.6 billion worth of imports and exports. This was more than the combined value of trade with Japan and the United States ($147.8 billion).\\nAustralian companies are keen to take a slice of the big Chinese market pie. Local Australian business owners also want to attract attention from Chinese Australians, Chinese tourists and Chinese students in Australia. One of the questions that I was frequently asked by my clients is how to localise their brands in the Chinese context.\\nIn my previous work experience in Australia, America and China, I was involved in the Chinese brand naming processes many times together with foreign companies and I understand the complexity of this sort of rebranding journey. I am happy to share with you my knowledge and previous project experience during this session, meanwhile, I am looking forward to discussing with you about your challenges or questions.\\nAt this workshop, we will discuss:\\n\\nWhy do we need a Chinese brand name\\nBasic approaches to create a Chinese naming and examples\\nNaming process, tips and case sharing\\nQ&A\\n\\nJoin us at this workshop to explore together on this interesting topic.','It is no doubt that the relationship between Australia and China is becoming stronger. In 2017-18, China was by far Australia\'s largest tra','https://www.eventbrite.com.au/e/how-to-create-a-chinese-name-for-your-brand-tickets-60292716137?aff=ebapi','21/05/2019','12:30:00','13:30:00','31501297','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60256020%2F236755815315%2F1%2Foriginal.20190412-022607?h=200&w=450&auto=compress&rect=0%2C51%2C396%2C198&s=bab391d5249b58db6d687cb780e21b12','Chinese','700 Bourke Street, Dockland, VIC 3008'),('60508939868','ACBC Vic: China and the world: Inside a changing economic relationship','*Melbourne Event*\\nACBC Victoria warmly invites you to attend our event - China and the world: Inside a changing economic relationship with Jeongmin Seong, Senior Fellow, McKinsey Global Institute\\nThis event is focused on China’s evolving participation in, and relationship with, the world. The discussion will focus on how China’s evolving position in the world will affect Australian business interests and comes at time of significant shifts in the global economy, and as tensions between the US and China simmer. \\nAt this event we are delighted to be joined by Jeongmin Seong, author of the McKinsey Report China and the world: Inside a changing economic relationship. Jeongmin is a Shanghai-based China expert from McKinsey Global Institute. The themes of the Report were explored as part of a McKinsey Global Institute publication in December titled China and the world: Inside a changing economic relationship.\\nSpeaker Bio \\nJeongmin Seong is Senior Fellow at the McKinsey Global Institute, McKinsey & Company’s business and economics research arm. He leads MGI research teams in China, working on global as well as emerging market-focused themes.\\nJeongmin’s recent research has focused on globalization, technology, innovation and economic development. He has co-authored several MGI reports and discussion papers, including China and the World: Inside a changing economic relationship. \\nPrior to joining MGI, Jeongmin worked with companies around the world focusing on consumer facing industries including consumer electronics, retail, and automotive. Jeongmin also led McKinsey’s emerging market growth service line.\\nPrior to joining McKinsey Shanghai office, Jeongmin worked as a product marketing manager at Dell. Jeongmin is a graduate of Harvard Business School where he received his MBA degree.','*Melbourne Event*\\nACBC Victoria warmly invites you to attend our event - China and the world: Inside a changing economic relationship with J','https://www.eventbrite.com.au/e/acbc-vic-china-and-the-world-inside-a-changing-economic-relationship-tickets-60508939868?aff=ebapi','23/05/2019','18:00:00','19:30:00','31591882','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60586648%2F238725079340%2F1%2Foriginal.20190418-002644?h=200&w=450&auto=compress&rect=36%2C68%2C2372%2C1186&s=b4f50f67b68a97abf1c87227e771ca93','Chinese','Level 23 Rialto Towers, 525 Collins Street, Melbourne, VIC 3000'),('60513260792','ACETIE 2019 CONFERENCE - 2019 澳中博览会（墨尔本）论坛','In the face of new challenges of global protectionism in recent years, what should Australia and China do?','In the face of new challenges of global protectionism in recent years, what should Australia and China do?','https://www.eventbrite.com.au/e/acetie-2019-conference-2019-tickets-60513260792?aff=ebapi','12/07/2019','9:00:00','17:00:00','31593074','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60522555%2F294802089740%2F1%2Foriginal.20190417-071545?h=200&w=450&auto=compress&rect=0%2C15%2C1920%2C960&s=0291b3a53ffc0cb22bd24eb532c7f3d4','Chinese','1 Convention Centre Place, South Wharf, VIC 3006'),('60698753606','Cracking the China Code for HealthTech; ACTI','China is the second largest and fastest growing medtech and pharma market. Over the last few years, this has resulted in increasing investment interest by Chinese medtech and pharma into the Australian healthcare and medical research sector.\\nThe ACTI workshop will tangibly provide CEOs and senior Australian executives of medtech and broader healthcare companies the knowledge to help them develop a successful China business strategy. The event will incorporate sessions on developing a market entry strategy; successful partnering approaches; regulatory pathways; distribution and marketing; market risks; common pitfalls; and key success factors for Australian healthcare products, technologies and services into China.\\n16th May:\\n\\nStart: 8:30am registration for a 9:00am start\\nFinish: 5:30pm\\n\\nDelivery Partner: \\nACHA provides a guided pathway to give Australian health Startups direct access to Asian (in particular China) markets, addressing the gap between huge health technology demand from Asia and unreadiness of health start-ups in Australia to access Asian market. ACHA\'s biannual education programme (UprAsia) offers a cohort of about 8 startup founders who have completed other incubator programs, an intensive Asian-focused training and mentoring and extensive knowledge of market conditions and business culture. It equips them with comprehensive knowledge, robust competitiveness and links them with potential partners and investors. It is followed by acceleration process and business development assistance.\\n\\nACTI is supported by funding from the Australian Government under its Entrepreneurs’ Programme and JIMC/HiMed (Shanghai)','China is the second largest and fastest growing medtech and pharma market. Over the last few years, this has resulted in increasing investme','https://www.eventbrite.com.au/e/cracking-the-china-code-for-healthtech-acti-tickets-60698753606?aff=ebapi','16/05/2019','8:30:00','17:30:00','32005945','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F60803461%2F262578619422%2F1%2Foriginal.20190423-041213?h=200&w=450&auto=compress&rect=0%2C0%2C800%2C400&s=c71c0485ad57da999fdd36c3e29e993a','Chinese','90 Collins Street Level 14, Melbourne, VIC 3000'),('60795208104','Sonali Bhadauria Melbourne Workshops','Join incredible choreographer and YouTuber Sonali Bhadauria (India) for two masterclasses in Melbourne on Saturday the 25th of May 2019 only!\\n2pm - 4pm Bollywood\\n4:30pm - 6:30pm Bollyhop\\nJungle City Studios - 7b/7-9 Hope St, Brunswick\\nTickets will be $50.00 on the door!','Join incredible choreographer and YouTuber Sonali Bhadauria (India) for two masterclasses in Melbourne on Saturday the 25th of May 2019 only','https://www.eventbrite.com.au/e/sonali-bhadauria-melbourne-workshops-tickets-60795208104?aff=ebapi','25/05/2019','14:00:00','18:30:00','31899782','','Indian','7b/7-9 Hope St, Brunswick, VIC 3056'),('61016035605','Ancient Now - Creative dialogues with contemporary China','This forum will launch the #15 issue of Garland magazine, with a focus on China. The discussion will feature perspectives on the possibilities of cultural and artistic exchange with China today.\\nPanel – Working in China as an artist\\nTime: 2-3:30pm\\nThis panel is an opportunity to learn from those who are engaged with China as artists or curators.\\n\\nWhat are the challenges in connecting with audiences in mainland China?\\nWhat opportunities make the effort worthwhile?\\nHow can we maintain contact with the Chinese scene from Australia?\\n\\nPanel – Conversation between dragons\\nTime: 3:30-5pm\\nThis panel explores the creative substance of a dialogue with China. As a nation that seeks to revive its traditional culture, how does this parallel the trajectory of nations around the Pacific Rim? We learn from the dragons not only in China but also in Mexico, Australia and India. Do they still have a place in our lives? Does their relation to unpredictable weather help us acknowledge the reality of climate change? Are there other ancient beliefs that may have a renewed relevance today?\\nFor more information and speakers, go to our event page. \\nThe image is from Robin Best, of ceramic work made in Jingdezhen','This forum will launch the #15 issue of Garland magazine, with a focus on China. The discussion will feature perspectives on the possibiliti','https://www.eventbrite.com.au/e/ancient-now-creative-dialogues-with-contemporary-china-tickets-61016035605?aff=ebapi','22/06/2019','14:00:00','17:00:00','32170668','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F62030890%2F2585833006%2F1%2Foriginal.20190510-014208?h=200&w=450&auto=compress&rect=0%2C44%2C1280%2C640&s=bb7bbc666ce826e32a5b6ce11da99e3b','Chinese','Theatrette Federation Square, Melbourne, VIC 3000'),('61079951780','Vegan curries of India','Calling all Indian curry fans, this vegan friendly cooking class is for you. Learn to cook healthy and easy vegan Indian curries, including the famous dal makhani, pumpkin curry, baingan bharta (roasted eggplant with spices, onions and tomatoes) as well as peas pulao (rice cooked with peas and spices). Learn the rich history of Indian curries along with nutritional and health benefits of spices and herbs.\\nWhat you will learn\\n\\nhow to make a traditional North Indian cuisine\\nhealth benefits of herbs and spices\\nhands on cooking practice\\n\\nWhat you will get\\n\\ntaste testers and food to take home\\nrecipes\\ntips and knowledge to take home and put into practice\\n\\nWhat to bring\\n\\napron\\ncontainer\\n\\nAbout the tutor\\nA specialist in authentic North Indian cuisine, Seema Choubey teaches cooking classes across Melbourne. Her teaching style is informal, hands on, interactive and always lots of fun for participants. Seema joyfully shares her skills, traditional cuisine and culture with all.','Calling all Indian curry fans, this vegan friendly cooking class is for you. Learn to cook healthy and easy vegan Indian curries, including','https://www.eventbrite.com.au/e/vegan-curries-of-india-tickets-61079951780?aff=ebapi','26/05/2019','10:00:00','13:00:00','24147257','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61400634%2F251962278621%2F1%2Foriginal.jpg?h=200&w=450&auto=compress&rect=0%2C447%2C3576%2C1788&s=54164f722935c5ce256433b2e20d3f95','Indian','59 Francis Street, Yarraville, VIC 3013'),('61080140344','North Indian feast cooking class','Learn to cook healthy and easy North Indian vegetarian cuisine, including a dry vegetable dish (aloo gobi – potato and cauliflower tossed with Indian spices), cucumber raita (spiced non-dairy yoghurt with cucumber), bhajia (vegetables coated with chickpea flour and fried) and peas pulav ( rice cooked along with peas and spices) . Pick up cooking tips and tricks, and learn about the nutritional and health benefits of spices and herbs. This is a vegetarian class with vegan options included.\\nWhat you will learn\\n\\nhow to make a traditional North Indian cuisine\\nhealth benefits of herbs and spices\\nhands on cooking practice\\n\\nWhat you will get\\n\\ntaste testers and food to take home\\nrecipes\\ntips and knowledge to take home and put into practice\\n\\nWhat to bring\\n\\napron\\ncontainer\\n\\nAbout the tutor\\nA specialist in authentic North Indian cuisine, Seema Choubey teaches cooking classes across Melbourne. Her teaching style is informal, hands on, interactive and always lots of fun for participants. Seema joyfully shares her skills, traditional cuisine and culture with all.','Learn to cook healthy and easy North Indian vegetarian cuisine, including a dry vegetable dish (aloo gobi – potato and cauliflower tossed w','https://www.eventbrite.com.au/e/north-indian-feast-cooking-class-tickets-61080140344?aff=ebapi','16/06/2019','10:00:00','13:00:00','24147257','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61400887%2F251962278621%2F1%2Foriginal.20190430-012805?h=200&w=450&auto=compress&rect=65%2C0%2C2606%2C1303&s=94da99cdc2235cbb246bab0aa0b08e47','Indian','59 Francis Street, Yarraville, VIC 3013'),('61086039990','A road-map to success in China\'s unique digital ecosystem','China’s strict internet regulation has favoured the emergence of a parallel digital ecosystem. There’s no Facebook, no Twitter, no Google – and yet international marketers need to find a way to reach their Chinese target audience online.\\nThis session will provide attendees with an overview of the intricacies of the Chinese online ecosystem, offer recommendations on how to crack into China’s digital space and provide practical advice for overcoming technical hurdles, getting found Chinese search engines and setting up a WeChat official account.\\n\\n\\n\\nEvent details:\\nDate: Wednesday 19 June 2019Time: 12-2.00pmLocation: The Cluster (Warehouse 21): Level 21, 31 Queen Street, Melbourne  Ticket price: $25 + GSTLunch: A light lunch and refreshments will be served.\\n\\n\\n\\nIntroducing our Presenter: Nicolas Chu\\n\\n\\n\\nA global digital thought-leader, Nicolas Chu is the CEO and founder of Sinorbis, the multi-award-winning company that revolutionises the way businesses and organisations enter the Chinese market through technology.\\nHe is an active mentor for a number of technology and digital initiatives in Asia Pacific and also serves as a Professor of Practice at the UNSW Business School in Sydney.\\nPrior to founding Sinorbis, he was the global President of HotelClub and Ebookers, two leading global online companies operating in more than 30 markets with an annual turnover of US$2.5 billion. HotelClub and Ebookers were part of Orbitz Worldwide, which was acquired for US1.6bn in 2015.\\nNicolas also spent eight years at Expedia, holding executive positions in Europe and Asia Pacific. For several years he led the APAC retail and product strategy for the group and then was the Managing Director of Expedia Australia and New Zealand. Under his leadership, the company became the leading online travel agency in the region.','China’s strict internet regulation has favoured the emergence of a parallel digital ecosystem. There’s no Facebook, no Twitter, no Google –','https://www.eventbrite.com.au/e/a-road-map-to-success-in-chinas-unique-digital-ecosystem-tickets-61086039990?aff=ebapi','19/06/2019','12:00:00','14:00:00','31898620','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61954765%2F192283026814%2F1%2Foriginal.20190509-025637?h=200&w=450&auto=compress&rect=0%2C0%2C2160%2C1080&s=70153afa44ba9a135a1523dffe4ae806','Chinese','31 Queen Street, Melbourne, VIC 3000'),('61087930645','ACYPI Melbourne and The HKABA (Victoria) Autumn Networking Drinks','Australia-China Young Professionals Initiative and The Hong Kong Australia Business Association (Victoria) present: Autumn networking drinks\\nACYPI Melbourne and the Young Professionals Alliance of the Hong Kong Australia Business Association (Victoria) invite you to join fellow members and friends for casual networking drinks.\\n\\n\\nDate:  Wednesday 29 May, 5:30pm\\n\\n\\nVenue:  Seamstress Downstairs, 113 Lonsdale Street, Melbourne\\n\\n\\nTickets:  Free of charge. Drinks available at bar prices. \\n\\n\\nBook your free ticket now!\\nThe Hong Kong-Australia Business Association Limited (HKABA) Victoria was established 1987 aiming to promote a positive image for Hong Kong and to reinforce economic ties between Hong Kong SAR/China and Australia. More information available at https://www.linkedin.com/company/hkaba-victoria-chapter/','Australia-China Young Professionals Initiative and The Hong Kong Australia Business Association (Victoria) present: Autumn networking drinks','https://www.eventbrite.com.au/e/acypi-melbourne-and-the-hkaba-victoria-autumn-networking-drinks-tickets-61087930645?aff=ebapi','29/05/2019','17:30:00','20:30:00','32135115','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61411668%2F234256511805%2F1%2Foriginal.20190430-074202?h=200&w=450&auto=compress&rect=0%2C431%2C5184%2C2592&s=8a9a190ca40534d2d8fd4284be46e177','Chinese','113 Lonsdale Street, Melbourne, VIC 3000'),('61139748634','Book Launch: Resource Politics & Militarization in Northeast India','Living with Oil and Coal\\nResource Politics and Militarization in Northeast India\\nDOLLY KIKON\\nJoin us at the Australia India Institute to launch Dolly Kikon\'s book: Living with Oil and Coal. Dolly will provide a short introduction to the book before turning to the floor for a question and answer session. \\nFood and drink will be provided so registration is essential. \\nAbout the book:\\nThe nineteenth-century discovery of oil in the eastern Himalayan foothills, together with the establishment of tea plantations and other extractive industries, continues to have a profound impact on life in the region. In the Indian states of Assam and Nagaland, everyday militarization, violence, and the scramble for natural resources regulate the lives of Naga, Ahom, and Adivasi people, as well as migrants from elsewhere in the region, as they struggle to find peace and work.\\nAnthropologist Dolly Kikon uses in-depth ethnographic accounts to address the complexity of Northeast India, a region between Southeast Asia and China where boundaries and borders are made, disputed, and maintained. Bringing a fresh and exciting direction to borderland studies, she explores the social bonds established through practices of resource extraction and the tensions these relations generate, focusing on peoples\' love for the landscape and for the state, as well as for family, friends, and neighbours. Living with Oil and Coal illuminates questions of citizenship, social justice, and environmental politics that are shared by communities worldwide.\\nAbout the author:\\nDolly Kikon is a senior lecturer in the Anthropology and Development Studies Program at the University of Melbourne. She is the author of Life and Dignity: Women\'s Testimonies of Sexual Violence in Dimapur (Nagaland) and Experiences of Naga Women in Armed Conflict: Narratives from a Militarized Society.','Living with Oil and Coal\\nResource Politics and Militarization in Northeast India\\nDOLLY KIKON\\nJoin us at the Australia India Institute to lau','https://www.eventbrite.com.au/e/book-launch-resource-politics-militarization-in-northeast-india-tickets-61139748634?aff=ebapi','28/05/2019','17:30:00','19:30:00','30221540','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61484348%2F15835790977%2F1%2Foriginal.20190501-060253?h=200&w=450&auto=compress&rect=0%2C0%2C2160%2C1080&s=967f1f337db46c2d82482e21c3e732b8','Indian','149 Barry Street, Carlton, VIC 3053'),('61216757971','Getting the Australia-China relationship right','This Public Forum hosted by the Asian Bureau of Economic Research and the China Center for International Economic Exchange takes a fresh lo','This Public Forum hosted by the Asian Bureau of Economic Research and the China Center for International Economic Exchange takes a fresh lo','https://www.eventbrite.com.au/e/getting-the-australia-china-relationship-right-registration-61216757971?aff=ebapi','21/05/2019','12:30:00','14:00:00','31899505','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61553557%2F305459971305%2F1%2Foriginal.20190502-051645?h=200&w=450&auto=compress&rect=0%2C0%2C440%2C220&s=fdc24c8fa8ed3a83a4d5808be819dba6','Chinese','Fellows Lane, The Australian National University , Canberra, ACT 2601'),('61217263483','Mental Health First Aid Training for Monash Chinese International Students','Free course for Monash Caulfield Chinese speaking international students!','Free course for Monash Caulfield Chinese speaking international students!','https://www.eventbrite.com.au/e/mental-health-first-aid-training-for-monash-chinese-international-students-tickets-61217263483?aff=ebapi','2/07/2019','9:30:00','17:00:00','31899722','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61887057%2F305461878563%2F1%2Foriginal.20190508-063648?h=200&w=450&auto=compress&rect=0%2C347%2C5000%2C2500&s=3b48b804508a5ca07924f962a225a93a','Chinese','Need to Register'),('61218549329','The Wihu Singing of the Tangshang / Tangsa Naga','The Tangsa or Tangshang Naga is a community of perhaps 100,000 living on both sides of the India-Myanmar border, mostly in the north of Sagaing Region and in Arunachal Pradesh on the India side. There are around 80 ‘sub-tribes’ of the Tangsa/Tangshang, each of which has its own linguistic variety. Some of these are fully mutually intelligible, effectively different dialects, but some are so different as to be not mutually intelligible. They represent a significant part of the many 100s of Naga languages and dialects.\\nThis presentation, which will be illustrated by video and audio examples, will discuss and analyse traditional songs of the Tangsa.\\nSpeakers:\\nStephen Morey is a Senior Lecturer in the Department of Languages and Linguistics, La Trobe University. He has researched smaller, underdescribed languages on both sides of the India-Myanmar\\nborder, belong to the Tai, Singpho and Naga language groups. This work has included a detailed documentation and study of traditional songs. He also researches the historical materials relating to the indigenous languages of Victoria.\\nJürgen Schöpf studied musicology, linguistics, and anthropology at the Universität Göttingen, Germany. He worked as a recording engineer while preparing his doctoral dissertation in Ethnomusicology. He is now at La Trobe University, documenting minority cultures in the Northeast India/Myanmar border area.\\nVong Tsuh Shi is a post graduate student in Latrobe University. Her study focuses on Wihu song of Tangsa / Tangshang Naga. She did her Masters degree in Linguistics in Payap University, Thailand, later working with a prominent linguistics NGO. Before resuming her doctoral study, she volunteered to help more than fifty ethnic language groups in writing language guides for language teachers in a UNICEF (Myanmar) project.\\n\\n5:30pm for a 6:00pm start. Please RSVP for catering purposes.\\nThis event is a partnership between the Australian Myanmar Institute (AMI) and La Trobe Asia.','The Tangsa or Tangshang Naga is a community of perhaps 100,000 living on both sides of the India-Myanmar border, mostly in the north of Saga','https://www.eventbrite.com.au/e/the-wihu-singing-of-the-tangshang-tangsa-naga-tickets-61218549329?aff=ebapi','27/05/2019','17:30:00','19:00:00','20207772','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61555386%2F119466670519%2F1%2Foriginal.20190502-063434?h=200&w=450&auto=compress&rect=0%2C288%2C3456%2C1728&s=5e79658c6bdeea3d41a9041609b60424','Indian','Board Room, Level 20 360 Collins Street, Melbourne, VIC 3000'),('61408601781','Women in Sports Leadership - on and off the field','MinterEllison, in partnership with the Australia China Business Council, are delighted to invite you to an Executive Luncheon for Women in Sports Leadership.Capitalising on the recent trade and sporting events in Shanghai, this lunch will keep everyone focussed on the important role which sport can play in strengthening bilateral trade and investment.Australia has enjoyed incredible sporting achievements on and off the field.  The theme for the lunch will explore how women have managed and led:\\n\\nmajor international sporting events like the Australian Open\\nthe corporations and government entities supporting the sports industry\\non-field sporting success and role modelling\\nsporting club boards and leagues\\ncommunity and stakeholder engagement; and\\nsocial and traditional media coverage\\n\\nThis exclusive invitation-only lunch will be an opportunity to meet with other senior executives from business, sport and government and to hear from Tennis Australia President & Chair and CEO of The a2 Milk Company, Jayne Hrdlicka and the Hon Linda Dessau, Governor of Victoria (TBC) fresh from her trip to Shanghai supporting the NBL and AFL in China.We hope you can join us.','MinterEllison, in partnership with the Australia China Business Council, are delighted to invite you to an Executive Luncheon for Women in S','https://www.eventbrite.com.au/e/women-in-sports-leadership-on-and-off-the-field-tickets-61408601781?aff=ebapi','14/06/2019','12:30:00','14:00:00','32002670','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61736532%2F239964854439%2F1%2Foriginal.20190506-040820?h=200&w=450&auto=compress&rect=0%2C31%2C1200%2C600&s=274fdc467edb4746b4b322888c071420','Chinese','Level 23, Rialto Towers 525 Collins Street, Melbourne, VIC 3000'),('61473243125','Six Harmonies Qigong Workshop with Master Simon Blow','Qigong is one of the components of the holistic system of Traditional Chinese Medicine (TCM). With regular practice Qigong helps cleanse the body of toxins, restore energy, reduce stress and anxiety and helps individuals maintain a healthy and active life.\\nLiu He Gong – Six Unity Exercise is an ancient health cultivation practise which has been influenced by the philosophy of Daoism, Traditional Chinese Medicine and further developed by experts at the Shanghai Qigong Research Institute in China. The word Liu He refers to the six directions upward, downward, East, West, South and North. The exercise allows the practitioner to connect with and become an integral part of the universe/environment.\\nThe workshop will be led by Master Simon Blow who has been a professional Qigong teacher (Laoshi) since 1992. He has received certification in Medical Qigong clinical practice from the World Health Organisation and initiation into Dragon Gate Daoism with the given name ‘Xin Si’, meaning ‘Genuine Wisdom’.','Qigong is one of the components of the holistic system of Traditional Chinese Medicine (TCM). With regular practice Qigong helps cleanse the','https://www.eventbrite.com.au/e/six-harmonies-qigong-workshop-with-master-simon-blow-tickets-61473243125?aff=ebapi','22/06/2019','9:30:00','16:30:00','32040023','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61799699%2F257974287140%2F1%2Foriginal.20190507-011226?h=200&w=450&auto=compress&rect=0%2C1059%2C5904%2C2952&s=efd713b8b1a8cfcd5a775c6df52f74e5','Chinese','2A BARKER STREET  Griffith, Canberra, ACT'),('61475702481','Toaster Bath','Join Jojo Chinaski, Keren Storai and Sofie Prints on a comedic ride to the underbelly of existence, in a show which speaks to the most self destructive parts of us all. After sold out shows during MICF, this is your chance to see Toaster Bath and find out why audiences have loved this \"very unhealthy show\"\" and said they \"\"would have laughed more but it hurt so much\"\" 50 min show at 7.00Stay after 8 for the regular exford comedy show until 10Content warnings: This show covers topics some audiences may find sensitive',' including suicide',' mental illness and domestic violence\"','Join Jojo Chinaski, Keren Storai and Sofie Prints on a comedic ride to the underbelly of existence, in a show which speaks to the most self','https://www.eventbrite.com.au/e/toaster-bath-tickets-61475702481?aff=ebapi','19:00:00','30/05/2019','20:00:00','32042348','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F61803643%2F85058300217%2F1%2Foriginal.20190507-025802?h=200&w=450&auto=compress&rect=0%2C114%2C976%2C488&s=a1c05f35dc34180c6fe660157ba8c809'),('61673325577','Walking the tightrope:  Changing Chinese approaches to outward strategic investment, and Australia’s existing and possible responses’','The post-war multilateral framework of international finance, trade and law is being changed or replaced to accommodate China’s re-emergence as a great power. Within our region, China is already the greatest trading nation and is set to become the dominant provider of capital in the medium term and its laws are likely to increasingly regulate capital flows and trade.\\nAll of this means that profound change is coming for Australia from the top down and the bottom up. Unless we prepare, Australia could lose real leverage in that trade and foreign policy environment. Our current approach to trade and foreign investment is market orientated, relies upon the existing multilateral framework and benefits from standard choice of law provisions that privilege familiar common law jurisdictions (i.e. England and New York). That approach will be put under increasing pressure as China’s role on the world stage and within our region grows.\\nChris’ presentation will look at these trends, together with the impact of recent changes to Australia’s laws concerning foreign investment, influence and interference, and offer some future-proofing ideas.\\nBio\\nChris is a partner at Gilbert + Tobin where he sits on the firm’s Board and heads the firm’s energy and public international law practices. He has advised government and private clients in energy, energy security and public international law in over 55 countries. In the most strategically challenging global environment in many decades, Chris’ recent focus has been on Asia as that region accommodates China’s re-emergence. Most recently he has advised Papua New Guinea on energy security related matters, as well as other states on maritime claims and entitlements.\\nPro bono, Chris led the international legal team that worked with the Australian Government to help to secure the freedom of Australian journalist, Peter Greste, from incarceration in Egypt. He also provided support to counsel assisting to resist the capital punishment of Chan and Sukumaran in Indonesia. He is a founding director of the Alliance for Journalists’ Freedom.','The post-war multilateral framework of international finance, trade and law is being changed or replaced to accommodate China’s re-emergence','https://www.eventbrite.com.au/e/walking-the-tightrope-changing-chinese-approaches-to-outward-strategic-investment-and-australias-tickets-61673325577?aff=ebapi','21/05/2019','12:00:00','13:00:00','32171469','https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F62030406%2F154824664982%2F1%2Foriginal.20190510-012725?h=200&w=450&auto=compress&rect=0%2C0%2C2160%2C1080&s=a9646434834a6c2d300e86f9877ee8bd','Chinese','4 National Circuit, Canberra, ACT');
